lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:421:\"Kedves mindenki, nagy örömmel szeretnénk értesíteni titeket, hogy a mai naptól elkezdődött közel 60 nyelven kedvenc tartalomkezelő rendszerünk legújabb verziójának, a WordPress 4.4-nek a fordítása. Mivel a következő verziót decemberre ígérik a fejlesztők, így még sok minden változhat a kódban és a fordításokban is. Reméljük idén is inkább a Mikulás teszi a csizmánkba az új [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"DjZoNe\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:820:\"<p>Kedves mindenki,<br />\nnagy örömmel szeretnénk értesíteni titeket, hogy a mai naptól elkezdődött közel 60 nyelven kedvenc tartalomkezelő rendszerünk legújabb verziójának, a WordPress 4.4-nek a fordítása. </p>\n<p>Mivel a következő verziót decemberre ígérik a fejlesztők, így még sok minden változhat a kódban és a fordításokban is. Reméljük idén is inkább a Mikulás teszi a csizmánkba az új kiadást, mint, hogy a karácsony fa alatt találkozzunk vele.</p>\n<p>Aki esetleg úgy érzi, hogy segíteni szeretne a fordításban az <a href=\"https://translate.wordpress.org/projects/wp/dev/hu/default\" target=\"_blank\">itt megteheti</a>.</p>\n<p>Ha pedig megjött a kedved a fordításokhoz, <a href=\"http://wphu.org/segitseg\" target=\"_blank\">itt nem vész kárba a lelkesedésed</a>!</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"https://hu.wordpress.org/2015/10/30/elstartolt-a-4-4-forditasa/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s: