 este 8 órától elérhetetlen volt a teljes WordPress.org, így a csomagépítő felületre sem lehetett belépni, amikor ez végre sikerült hajnal [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"DjZoNe\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1606:\"<p>Elég régen nem fordult elő olyan, hogy a hivatalos verzió kiadása után egy órával még nem jött ki a magyar csomag, idén a kiadás ütközött némi nehézségbe ütközött.</p>\n<p>Mindenek előtt a hatalmas érdeklődés miatt tegnap este 8 órától elérhetetlen volt a teljes WordPress.org, így a csomagépítő felületre sem lehetett belépni, amikor ez végre sikerült hajnal 3-kor, akkor jöttem rá, hogy bizony az SVN repositoryba nem lettek feltöltve a szükséges fájlok még a kiadáshoz, ezért ezt reggelre napoltam. Reggel további nehézségek jöttek, megláttam, hogy az olvasdel.html ami minden magyar csomagnak a része már elég régen nem készült el magyarul, és ezt még hozzá kell igazítani a mostani readme.html-hez. Valamint a kiadáshoz tartozó videó fordítását is reggel véglegesítettem, de még mindig nem tudtam feltölteni, mivel a wordpress.tv oldalán jelenleg nincs magyar nyelv a listán, így erre még várni kell.</p>\n<p>Továbbá kikerült a korábbi hu_HU.php -ból a magyar video embed támogatás, a legutóbbi verziókor <strong>nacin</strong> kérte, hogy ne tegyünk bele semmit, mert már nem támogatott ez a metódus, ezért külön pluginként belekerült, és kibővült egy újabb szolgáltatóval is, így ha valakinek erre lenne szüksége keresse a magyar csomag telepítése után a <strong>Magyar&nbsp;Video&nbsp;Embed</strong> nevű bővítményt, és kapcsolja be. </p>\n<p>Bármilyen óhajt, sóhajt, panaszt és bánatot pedig írjatok meg nekünk a Kapcsolati űrlapon keresztül, a Fórumba, vagy Facebookon.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"https://hu.wordpress.org/2015/08/19/wordpress-4-3-billie/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"Segítség oldal frissítés\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:61:\"https://hu.wordpress.org/2015/01/07/frissitett-segites-oldal/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"https://hu.wordpress.org/2015/01/07/frissitett-segites-oldal/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 07 Jan 2015 12:31:06 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Uncategorized\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://hu.wordpress.org/?p=75\";s:7:\"attribs\";a:1:{s:0:\