l_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:450:\"Képzeljétek el, az történt, hogy a 4.1 megjelenésére időzítve a magyar csomaghoz megjelent a következő magyar nyelvű oldalak videó tartalmainak automatikus beágyazása: tv2.hu vivatv.hu mtv.co.hu mno.hu noltv.hu indavideo.hu pixter.hu videa.hu Számtalan olyan magyar tartalom szolgáltatót tudunk még, akiknek vannak saját videó megoldásai, de sajnos az ő technológiájuk nem volt beágyazható ezen a módon, és ahogy [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"DjZoNe\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1453:\"<p>Képzeljétek el, az történt, hogy a 4.1 megjelenésére időzítve a magyar csomaghoz megjelent a következő magyar nyelvű oldalak videó tartalmainak automatikus beágyazása:</p>\n<ul>\n<li>tv2.hu</li>\n<li>vivatv.hu</li>\n<li>mtv.co.hu</li>\n<li>mno.hu</li>\n<li>noltv.hu</li>\n<li>indavideo.hu</li>\n<li>pixter.hu</li>\n<li>videa.hu</li>\n</ul>\n<p>Számtalan olyan magyar tartalom szolgáltatót tudunk még, akiknek vannak saját videó megoldásai, de sajnos az ő technológiájuk nem volt beágyazható ezen a módon, és ahogy láttam, nagyjából sehogy.</p>\n<p>A kimaradó oldalakról, és a kimaradás okairól <strong>WP_CONTEN_DIR/languages/hu_HU.php</strong> -ban talál részletes leírást, aki nagyon kíváncsi rá. Aki esetleg érintett a kimaradt oldalak fejlesztésében, és netán technikai segítségre van szükségük az oEmbed technológiával kapcsolatban, azok a kapcsolati űrlapon keresztül elérnek minket.</p>\n<p>A megoldás feltételezi azt, egy olyan modern sablon használatát, ahol be van állítva a globális <strong>$content_width</strong> nevű változó, ugyanis ez alapján számolódik a videók helyes mérete. Ez a megoldás 2010 óta van a WordPressben.</p>\n<p>Akinek pedig a fenti újítás nincs ínyére, az egyszerűen tegyen a fent említett fájl utolsó sora elé egy # -ot, valahogy így:</p>\n<blockquote><p>\n#add_action( &#8216;init&#8217;, &#8216;magyar_video_embeds&#8217; );\n</p></blockquote>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"https://hu.wordpress.org/2014/12/19/magyar-video-beagyazasok-az-uj-4-1-ben/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:38:\"Találkozz a WordPress fejlesztőivel!\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"https://hu.wordpress.org/2011/10/18/talalkozz-a-wordpress-fejlesztoivel/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"https://hu.wordpress.org/2011/10/18/talalkozz-a-wordpress-fejlesztoivel/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 18 Oct 2011 14:00:13 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"Gépház\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"http://hu.wordpress.org/?p=30\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:437:\"Örömmel jelentjük be a kedves olvasó, és WordPress-t használó közösségnek, hogy a WordPress-t fejlesztő csapat, az Automattic, szinte teljes legénysége Budapesten lesz október 20 és 27 között. Az alapító, Matt Mullenweg szeretne találkozni magyarországi WordPressesekkel. Úgy tudom, ez az első alkalom, hogy a teljes csapat Magyarországon jár, így érdemes lesz kihasználni a lehetőséget! Szóval a [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"DjZoNe\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:992:\"<p>Örömmel jelentjük be a kedves olvasó, és WordPress-t használó közösségnek, hogy a WordPress-t fejlesztő csapat, az Automattic, szinte teljes legénysége <strong>Budapesten lesz</strong> október 20 és 27 között.</p>\n<p>Az alapító, Matt Mullenweg szeretne találkozni magyarországi WordPressesekkel. Úgy tudom, ez az első alkalom, hogy a teljes csapat Magyarországon jár, így érdemes lesz kihasználni a lehetőséget!</p>\n<p>Szóval a terv az, hogy közel 80 Automattic alkalmazottal egy közös, laza, beszélgetős és iszogatós, amolyan kocka estet fogunk tartani, ami kötetlen beszélgetésekre ad lehetőséget.</p>\n<p>Így nem lesz semmi komolykodás, sem prezentáció, sem semmi hasonló ültetett dolog.</p>\n<p>A helyszín az Instant (ők választották) lesz, az időpont pedig este 9-től zárásig, ami hajnali 2-3-at jelent.</p>\n<p><a href=\"https://www.facebook.com/event.php?eid=108140525963547\" target=\"_blank\">Jelentkezéshez kattints ide</a></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"https://hu.wordpress.org/2011/10/18/talalkozz-a-wordpress-fejlesztoivel/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:57:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n		\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:48:\"A király új ruhája – megújult a fórumunk!\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:75:\"https://hu.wordpress.org/2009/09/08/a-kiraly-uj-ruhaja-megujult-a-forumunk/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:83:\"https://hu.wordpress.org/2009/09/08/a-kiraly-uj-ruhaja-megujult-a-forumunk/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 08 Sep 2009 12:20:34 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:6:{i:0;a:5:{s:4:\"data\";s:8:\"Gépház\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:6:\"fórum\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:7:\"bbpress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:5:\"punbb\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:4;a:5:{s:4:\"data\";s:3:\"ipb\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:5;a:5:{s:4:\"data\";s:9:\"vbulletin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"http://hu.wordpress.org/?p=25\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:455:\"Ahogyan tapasztalhattátok az elmúlt pár órában a fórum elérhetetlen volt. De most már minden szebb és jobb, mint előtte. A továbbiakban váltás okairól szeretnék egy kicsit mesélni, azoknak, akiket érdekel. Amikor elkezdtünk komolyabban csapattá szerveződni, mi akik moderátorok és adminok vagyunk, valamint a Magyar WordPress Projectben részt veszünk, elköteleztük magunkat a WordPress terjeszetésében, a kapcsolódó [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"DjZoNe\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:2330:\"<p>Ahogyan tapasztalhattátok az elmúlt pár órában a fórum elérhetetlen volt.<br />\nDe most már minden szebb és jobb, mint előtte.</p>\n<p>A továbbiakban váltás okairól szeretnék egy kicsit mesélni, azoknak, akiket érdekel.<br />\n<span id=\"more-25\"></span></p>\n<p>Amikor elkezdtünk komolyabban csapattá szerveződni, mi akik moderátorok és adminok vagyunk, valamint a Magyar WordPress Projectben részt veszünk, elköteleztük magunkat a WordPress terjeszetésében, a kapcsolódó technológiák támogatásában, és a felhasználók segítésében.</p>\n<p>Az utóbbiban támadtak nehézségeink az utóbbi időben, ugyanis mióta egyre népszerűbb ez a cms rendszer/blog motor/publikációs platform felbukkantak nem kívánatos elemek, akik örömüket lelték abban, hogy vandálkodni jártak a fórumunka. (trollok)</p>\n<p>Ekkor ébredtünk rá, hogy az eddig használt <strong>PunBB</strong> rendszer nagy hiányosságaiba ütköztünk, és számunkra már nem alkalmas további használatra.</p>\n<p>Gondolkodtunk alternatívákon, hogy mivel lehetne az adatok megtartása mellett leváltani.</p>\n<p>Szempont voltak:</p>\n<ul>\n<li> könnyű kezelhetőség</li>\n<li>moderációs lehetőségek</li>\n<li>kereső barát URL támogatás</li>\n<li>migráló eszközök</li>\n<li>webkettes szolgáltatások támogatása</li>\n</ul>\n<p>Ezek alapján sajnos a <strong>bbPress</strong>-t ki kellett ejtenünk a sorból. Mivel, bár a WordPress kis testvére, és egy nagyon jó fórum rendszer, sajnos a céljainknak ez sem felet meg (ezzel nem zárom ki a lehetőséget, hogy ez a jövőben sem lesz így, viszont még kell neki pár év mire igazán beérik).</p>\n<p>Gyakorlatilag két alternatívánk maradt a <strong>vBulletin</strong> és az <strong>IPB</strong>, és mint láthatjátok ez utóbbi mellett döntöttünk.<br />\nMindenben messze-messze megfelelt az elvárásainknak, sőt egészen sok extrát is tartogatott számunkra.<br />\nAz, hogy az ára is kedvezőbb volt, már csak kellemes ráadás.</p>\n<p>Szóval, meghalt a király(??), éljen a király.<br />\nHasználjátok egészséggel az <a href=\"http://forum.word-press.hu\" target=\"_blank\">új fórum</a>ot.</p>\n<p>Zárszóként pedig, ezúton szeretnénk megköszönni a fordítást az <a href=\"http://ipboard.hu/\">IPB Magyarország</a>nak.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"https://hu.wordpress.org/2009/09/08/a-kiraly-uj-ruhaja-megujult-a-forumunk/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:45:\"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Egy kis macera\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"https://hu.wordpress.org/2009/08/17/egy-kis-macera/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"https://hu.wordpress.org/2009/08/17/egy-kis-macera/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 17 Aug 2009 12:21:58 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:8:\"Gépház\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s