INSERT INTO `refbk_posts` VALUES (2,1,'2015-09-06 10:19:34','2015-09-06 10:19:34','','Főoldal','Budakalászi Református Egyház','publish','closed','closed','','mainpage','','','2015-12-06 00:27:43','2015-12-06 00:27:43','',0,'http://localhost/?page_id=2',0,'page','',0),(10,1,'2015-09-27 15:47:08','2015-09-27 15:47:08','mainpage :)','mainpage','','inherit','closed','closed','','2-revision-v1','','','2015-09-27 15:47:08','2015-09-27 15:47:08','',2,'http://localhost/2015/09/27/2-revision-v1/',0,'revision','',0),(14,1,'2015-12-05 18:38:26','2015-12-05 18:38:26','http://localhost/wp-content/uploads/2015/12/cropped-budref1.jpg','cropped-budref1.jpg','','inherit','closed','closed','','cropped-budref1-jpg','','','2015-12-05 18:38:26','2015-12-05 18:38:26','',0,'http://localhost/wp-content/uploads/2015/12/cropped-budref1.jpg',0,'attachment','image/jpeg',0),(17,1,'2015-12-05 19:01:00','2015-12-05 19:01:00','','mainpage','Budakalászi Református Egyház','inherit','closed','closed','','2-revision-v1','','','2015-12-05 19:01:00','2015-12-05 19:01:00','',2,'http://localhost/2015/12/05/2-revision-v1/',0,'revision','',0),(20,1,'2015-12-05 22:30:14','2015-12-05 22:30:14','','budrefogo1_100','','inherit','open','closed','','budrefogo1_100-3','','','2015-12-05 22:30:14','2015-12-05 22:30:14','',0,'http://localhost/wp-content/uploads/2015/12/budrefogo1_1002.png',0,'attachment','image/png',0),(21,1,'2015-12-05 22:53:40','2015-12-05 22:53:40','<h3>Gyülekezetünk neve: Budakalászi Református Egyház</h3>\r\nAz egyház Szentírás képeivel élve: olyan család, ahol a családfő Jézus Krisztus, Olyan nép, amelynek királya a mennyben uralkodó Fiúisten, olyan nyáj, amelyre igaz, hogy pásztora életét adta érte, és megmentette, olyan test, ahol Krisztus a fő, mi pedig a test tagjai.\r\n\r\nAz egyház szavunk egyébként nem az „egy” és a „ház” szavak összetételéből született. Eredeti formájában mint „üdvház, idvház” hangzott, és olyan háznépet, családot, közösséget jelölt, amelynek tagjaira igaz, hogy – bár bűnösök – Jézus Krisztus áldozatáért bűnbocsánatot, és üdvösséget, örök életet kaptak.\r\n\r\nA református jelzőnek kettős jelentése van. A szó maga annyit jelent: re-formált, vissza-alakított, visszaformált. Az a célunk, hogy az egyház közösségi életét, de az egyház tagjainak személyes életét is Isten akarata szerint, a Szentírás tanításának megfelelően alakítsuk ki, ahhoz formáljuk vissza.\r\n\r\nJelenti azonban ez a szó a reformáció korának hitvallásaihoz, azok biblikus tanításához való elkötelezett ragaszkodásunkat is. Ezen hit-vallások alapján tartozunk a Magyarországi Református Egyház egyházainak közösségébe, valamint határainkon túl élő magyar, vagy más anyanyelvű, de azonos hitvallást követő egyházak családjába.\r\n\r\nAz egyház célja, hogy felismerje és betöltse küldetését: Dicsérje Istenét, és hirdesse Jézus Krisztus örömhírét. Legyen „kiáltó szó a pusztában”. Jézus szavaival: só, amely az Istennek tetsző élet ízét hirdeti, és világosság, amely Jézus Krisztus kegyelme által az örömhír fényét és melegét sugározza abba a közösségbe, amelybe Krisztus állította. Az egyház nem lezárt közösség, bárki csatlakozhat hozzá, aki hisz Jézus Krisztusban, és követni akarja Őt földi életén át.\r\n<h3>Hitvallásunkból: Mit hiszel az egyetemes keresztyén egyházról?</h3>\r\nHiszem, hogy Isten Fia a világ kezdetétől fogva annak végéig az egész emberi nemzetségből Szentlelke és Igéje által az igaz hit egységében egy kiválasztott gyülekezetet gyűjt egybe, azt oltalmazza és megőrzi. És hiszem, hogy annak én is élő tagja vagyok, és örökre az is maradok.','Mi az a református egyház?','','publish','closed','closed','','mi-az-a-reformatus-egyhaz','','','2015-12-06 00:24:27','2015-12-06 00:24:27','',0,'http://localhost/?page_id=21',0,'page','',0),(22,1,'2015-12-05 22:53:40','2015-12-05 22:53:40','<h3>Gyülekezetünk neve: Budakalászi Református Egyház</h3>\r\nAz egyház Szentírás képeivel élve: olyan család, ahol a családfő Jézus Krisztus, Olyan nép, amelynek királya a mennyben uralko